  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consisted of the planning,
  acquisition, survey, processing and deliverable creation for 42 counties in Minnesota
  which include: Olmsted, Wabasha, Goodhue, St. Louis, Fillmore, Pine, Kanabec, Morrison,
  Mille Lacs, Waseca, Blue Earth, Steele, Dodge, Nicollet, Sibley, Freeborn, Faribault,
  Mower, Isanti, Anoka, Ramsey, Dakota, Wright, Scott, Washington, Rice, Hennepin,
  Le Sueur, Carver, Benton, Sherburne, Chisago, Koochiching, Itasca, Crow Wing, Aitkin,
  Carlton, Winona, Houston, Cook, and Lake. The tiling scheme was provided by the
  Minnesota Department of Natural Resources and is from the USGS 16th 1:24,000 quadrangle
  tiles. This data set is classified according to ASPRS specifications. Not all counties
  contain all classes. The classes are as follow: Class 0: Never Classified Class
  1: Unclassified Class 2: Ground Class 3: Low Vegetation Class 4: Medium Vegetation
  Class 5: High Vegetation Class 6: Buildings Class 7: Low Points (Noise) Class 8:
  Model Key-points Class 9: Water Class 10: Ignored Ground (Breakline Proximity) Class
  11: Scan Edge Class 12: Overlap The dates of collection for each data set are as
  follows: -Pine County: 10/25/2006 - 11/6/2006 -Chisago County: 04/18/2007 - 04/28/2007
  -Crow Wing County: 2008 -Wright County: 04/23/2008 - 05/28/2008 -Southeast: 11/18/2008
  - 12/28/2008 Wabasha County, Winona County, Houston County, Olmsted County, Fillmore
  County, Dodge County, Mower County, Freeborn County, Steele County, Rice County
  -Red River Basin: 4/19/2008 - Spring 2010 Le Sueur County, Waseca County, Faribault
  County, Sibley County, Nicollet County -Arrowhead: 05/03/2011 - 06/02/2011 Cook
  County, Lake County, St. Louis County, Carlton County -Twin Cities Metro: Spring/Fall
  2011, Spring 2012 Morrison County, Mille Lacs County, Kanabec County, Benton County,
  Isanti County, Anoka County, Sherburne County, Hennepin County, Ramsey County, Washington
  County, Dakota County, Carver County, Goodhue County, Scott County -Central Lakes
  Region: Spring 2012 Aitkin County -Blue Earth County: 04/06/2012\",\n\t\"license_title\":
